import PopularRestaurant from './popular-restaurants/PopularRestaurants';

const DUMMY_DATA = [
    {
      id: 'm1',
      image: '',
      name: 'Claro',
      chef: 'Ran Shmueli'
    },
    {
      id: 'm2',
      image: '',
      name: 'Lumina',
      chef: 'Meir Adoni'
    },
    {
      id: 'm3',
      image: '',
      name: 'Tiger Lilly',
      chef: 'Yanir Green'
    }
  ];


  const DummyData= () => {
      const popularList= DUMMY_DATA.map((restaurant) => (<PopularRestaurant key={restaurant.id} name={restaurant.name} chef={restaurant.chef} image={restaurant.image} />));
      return(
          <div>
             {popularList}
          </div>
      )
  }
  export default DummyData;
